window.bookSummaryJSON = "<p>It’s finally Nevermore time, as Jake and friends dive into the greatest mega-dungeon of the multiverse…</p> <p>Having evolved to C-grade successfully, Jake is ready to enter the most well-known World Wonder in the entire multiverse to get some sweet levels under his belt. However, Nevermore is far more than just an immense dungeon to power up in.</p> <p>It’s a competition where newly evolved C-grades compete on Leaderboards to prove themselves in front of the entire multiverse. Geniuses from every universe and faction appear, all of them vying for the top spot and to prove themselves the very best, like no one ever was.</p> <p>Faced with tough competition, Jake gleefully takes on the challenge. With four competent comrades at his side, they face floor after floor as he dives deeper and deeper into the depths of Nevermore, encountering new situations, horrible water levels, powerful monsters, Challenge Dungeons, and perhaps even the occasional labyrinth with an overly invested creator.</p> <p>Book 10 of the hit Primal Hunter LitRPG Series is here. Grab your copy today!</p> <p>About the Series: Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of Progression Fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
